"229743":{"id":"229743","name":"VTuber Legend: How I Went Viral after Forgetting to Turn Off My Stream","slug":"vtuber-legend-how-i-went-viral-after-forgetting-to-turn-off-my-stream","original_title":"VTuberなんだが配信切り忘れたら伝説になってた","overview":"Yuki Tanaka é uma VTuber no Live-On, uma das maiores empresas de VTubers do Japão, como a donzela educada Awayuki Kokorone. Um dia, ela esquece de encerrar a live e os espectadores conhecem sua verdadeira personalidade: irreverente, indecente e com uma tendência a beber depois de um longo dia. Yuki fica surpresa ao descobrir que este acidente fez com que suas posições no ranking se multiplicassem, então ela decide arregaçar as mangas e trabalhar! Ela ainda será uma estrela!","first_air_date":"2024-07-08","episode_run_time":24,"vote_average":6.143,"number_of_seasons":1,"number_of_episodes":12,"created_by":[],"production_companies":["TNK","KADOKAWA","movic","BS Nippon Corporation","DAXEL","AT-X","STUDIO MAUSU","KBS Kyoto"],"genres":["Animação","Comédia"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/6iGumVLx0NwlqR3DDVPfcNzhyoX.jpg","poster_path":"https://image.tmdb.org/t/p/original/4s97rYWqJAsAOeDn8Is09fkLcsc.jpg","cast":["Ayane Sakura","小林ゆう","Saku Mizuno","Machico","菊池紗矢香"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/4s97rYWqJAsAOeDn8Is09fkLcsc.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/4s97rYWqJAsAOeDn8Is09fkLcsc.jpg","air_date":"2024-07-08","episode_count":12,"overview":"N/A","vote_average":6.2,"episodes":{"1":{"name":"Episódio 1","overview":"Awayuki Kokorone é uma VTuber que não faz muito sucesso na internet. Até que um dia ela esquece sua live ligada e deixa de passar a ideia de pureza para os seus fãs.","air_date":"2024-07-08","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/j0XxCp2QmG2p3btpi7KeIx3kgpp.jpg","vote_average":7},"2":{"name":"Episódio 2","overview":"Depois de estourar com sua live imprevista, Awayuki começa a se enturmar com as outras VTubers. Mas será que suas collabs darão certo?","air_date":"2024-07-15","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/qqpeKXC7jZEjPAn50C3Rgd7gJyU.jpg","vote_average":6},"3":{"name":"Episódio 3","overview":"O microfone de Awayuki estraga e ela pede ajuda para sua amiga Chami. Enquanto isso, ela se prepara para a live de comemoração da sua monetização.","air_date":"2024-07-22","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/g02QJaqiH0WIdfHHp6qZ5MmJ9U3.jpg","vote_average":6},"4":{"name":"Episódio 4","overview":"Awayuki testa Long Fit, um jogo fitness. Após isso, finalmente chega a hora das VTubers gravarem um clipe. Mas será que a Awayuki vai conseguir manter a compostura?","air_date":"2024-07-29","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/i4xmnF0BXu3KxjEhwQN7oGRblAk.jpg","vote_average":6},"5":{"name":"Episódio 5","overview":"A Live-On revela a nova geração de VTubers... Mas cada uma traz uma revelação pior que outra...","air_date":"2024-08-05","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/nsBAJ5Lty93libXbwiem5jzASwW.jpg","vote_average":6},"6":{"name":"Episódio 6","overview":"Shuwa começa participando de um Quiz sobre animais com Eirai, a nova streamer da Live-On que é diretora de um zoológico. Depois disso, ela é convidada para fazer uma collab offline com a mamãe Shion!","air_date":"2024-08-12","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/zd8KfX16yzNM6gxEOhVwi80whN1.jpg","vote_average":6},"7":{"name":"Episódio 7","overview":"Awayuki encontra no caminho para o escritório uma colega VTuber e isso leva para uma collab um tanto incomum. Em seguida, Awayuki resolve ir com Chami pela primeira vez ao parque de diversões.","air_date":"2024-08-19","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/7fJfr7XYcOPnFohhItcFxPRVJdH.jpg","vote_average":0},"8":{"name":"Episódio 8","overview":"Awayuki conta a história de como ela recuperou suas GachiZero roubadas. Em seguida, ela se muda para um novo apartamento e convida Mashiro para passar uma noite.","air_date":"2024-08-26","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/1tdEqZLekWQejFGPzDhK1wrjBXq.jpg","vote_average":0},"9":{"name":"Episódio 9","overview":"Acompanhe o L-1 Grand Prix, uma competição em duplas para escolher a melhor esquete. Em seguida, acompanhe Shuwa e Eirai em um jogo de terror.","air_date":"2024-09-02","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/kXviwwuzAj87FpwDYKtdgt2jMWW.jpg","vote_average":0},"10":{"name":"Episódio 10","overview":"Toda a Live-On está reunida para um jogo online multiplayer de sobrevivência. Então, quem serão as traidoras? Quais delas irão sobreviver até o fim? Confira as garotas da Live-On jogando Lobisomem do Deserto!","air_date":"2024-09-09","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/zWie5wBSdMsENotklpQY89YFZZx.jpg","vote_average":0},"11":{"name":"Episódio 11","overview":"Awayuki é convidada para participar de um show solo, cantando ao lado de Hareru. Mas ela não consegue entender o motivo disso. Em meio a isso, Alice Soma e Mashiro Irodori marcam uma live para disputar o coração dela!","air_date":"2024-09-16","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/vTf4kchtm2xNfjfbOUsRLtNLDGP.jpg","vote_average":0},"12":{"name":"Episódio 12","overview":"Finalmente chega o momento do show de Hareru Asagiri. Mas qual será a grande revelação que ela tem a fazer?","air_date":"2024-09-23","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/h7qDlGIJdTmj3nRYRtkOdSUkTKy.jpg","vote_average":0}}}}},
