"201949":{"id":"201949","name":"Meu Trabalho no Café Yuri","slug":"meu-trabalho-no-cafe-yuri","original_title":"私の百合はお仕事です！","overview":"Hime é uma jovem que arranja um bico numa cafeteria muito estranha, onde as funcionárias fingem ser estudantes de um internato feminino. Ela se apaixona por sua colega de trabalho Mitsuki, que é sempre muito gentil com ela na frente dos outros clientes. Só tem um problema: a Mitsuki simplesmente não suporta a Hime!","first_air_date":"2023-04-06","episode_run_time":24,"vote_average":6.2,"number_of_seasons":1,"number_of_episodes":12,"created_by":[],"production_companies":["Passione","Studio Lings","infinite","Happinet Phantom Studios","Ichijinsha","Nippon Columbia"],"genres":["Animação","Comédia","Drama"],"certification":"12","backdrop_path":"https://image.tmdb.org/t/p/original/dWktdVHGKykJEGMc3Ex3aBfQq4d.jpg","poster_path":"https://image.tmdb.org/t/p/original/Ac96k19TTO7KBdn3JigaagJHjvQ.jpg","cast":["小倉唯","Sumire Uesaka","Minami Tanaka","Makoto Koichi","田村ゆかり"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/4sAEhGkhOynh1PQwfCKAcCTaxqw.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/4sAEhGkhOynh1PQwfCKAcCTaxqw.jpg","air_date":"2023-04-06","episode_count":12,"overview":"N/A","vote_average":3.5,"episodes":{"1":{"name":"Bem-vinda à Academia Feminina Liebe!","overview":"Hime Shiraki tem um desejo... de casar com um milionário da alta sociedade! E para isso, Hime finge uma personalidade fofa para conquistar a todos que a cercam. Um incidente faz com que ela tenha que substituir uma garota em uma cafeteria um pouco diferente do normal.","air_date":"2023-04-06","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/7Y9B80Tk2SvKV0oW6fwrL4j2OEo.jpg","vote_average":4},"2":{"name":"Vamos Ser Atendentes Juntas?","overview":"Hime precisa manter o seu emprego secreto em segredo dos outros, mas Kanoko, sua amiga, acaba descobrindo. Agora, Hime precisa contornar a situação sem fazer besteira!","air_date":"2023-04-13","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/tIXqtp9046nUcmPPBXlNG0TuHEl.jpg","vote_average":5.5},"3":{"name":"No Que Devo Acreditar?","overview":"Hime está decidida a fazer a sua fachada funcionar em Mitsuki! Entretanto, o medo de ser exposta devido a um trauma de infância continua causando um grande impacto no psicológico da colegial.","air_date":"2023-04-20","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/bRe8zPGDVoAFffYAKYSPSxJQnAb.jpg","vote_average":0},"4":{"name":"Eu Te Odeio","overview":"Uma revelação sobre Mitsuki cai como uma bomba para Hime. As lembranças do passado podem tornar a situação entre as duas ainda mais complicada.","air_date":"2023-04-27","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/2Al8x7DY98jLSPJKIqbLuvvLArN.jpg","vote_average":0},"5":{"name":"Se Pudéssemos Recomeçar","overview":"O conflito do passado de Hime e Mitsuki começou a causar problemas no salão da Liebe. Para que a situação não piore, Mai pede para que as duas conversem e se entendam de alguma forma.","air_date":"2023-05-04","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/chFgUSwt346X7l6tXZrAFoEdrJU.jpg","vote_average":0},"6":{"name":"Não Precisamos Mais Mentir?","overview":"Hime fica preocupada com os rumores sobre sua relação de Schwestern com Mitsuki. No salão, as duas tentam mostrar a melhora de sua relação para os visitantes.","air_date":"2023-05-11","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/52xyR7pL3torYmzp3IFSgnvYCrb.jpg","vote_average":0},"7":{"name":"Você é a “Gyaru”, Né?","overview":"Sumika tenta se aproximar de Kanoko, que por sua vez não possui a intenção se aproximar de ninguém que não seja sua amiga Hime. A gyaru, então, busca uma abordagem mais agressiva.","air_date":"2023-05-18","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/cRw3ZLRJQFdA7aR8A6QgwclwFA4.jpg","vote_average":0},"8":{"name":"Em Quem Eu Devo Votar?","overview":"Sumika percebe que a relação de Kanoko com Hime vai além de uma amizade, mas está incomodada com a possibilidade de romance entre as alunas da Liebe. Kanoko decide falar com Sumika e pedir sua ajuda.","air_date":"2023-05-25","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/ubTHtRRnNdrxvzUSDf1AC05jqcV.jpg","vote_average":0},"9":{"name":"A Única na Minha Vida","overview":"Abalada com a declaração de Sumika, Kanoko se lembra de quando começou a ter a sua relação especial com Hime.","air_date":"2023-06-01","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/cc7S6a41Lgm9F5JYO8NWnONSyU9.jpg","vote_average":0},"10":{"name":"Você Vai Quebrar?","overview":"Na expectativa de que Kanoko desista do seu amor por Hime, Sumika revela para Kanoko um antigo e traumático acontecimento para o salão.","air_date":"2023-06-08","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/aKQjNwIwcRJPvtpDWuPgyXLxvRh.jpg","vote_average":1},"11":{"name":"Blume der Liebe","overview":"É chegado o momento de contar os votos para a nova Blume der Liebe. Sumika insiste em conversar com Kanoko e resolver a situação.","air_date":"2023-06-15","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/fnLP8wDj49jG9prWsr8rwxGlNnS.jpg","vote_average":0},"12":{"name":"Bem-vindos Ao Verão na Academia Feminina Liebe!","overview":"Com o término das eleições para Blume, uma nova estação e adoráveis uniformes chegam para a Academia Feminina Liebe!","air_date":"2023-06-22","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/xssCTx7xJbQy7CSCHC6dO9hvp5l.jpg","vote_average":0}}}}},
