"210355":{"id":"210355","name":"Mecha-Ude: Mechanical Arms","slug":"mecha-ude-mechanical-arms","original_title":"メカウデ","overview":"A vida comum de Hikaru no ensino fundamental vira de cabeça para baixo quando ele encontra Alma, uma entidade alienígena que se assemelha a um membro mecanizado chamado \"Mecha-Ude\". Alma, parte de uma espécie rara, está fugindo de um grupo assustador que caça seres como ela em busca de um poder incomparável. Com ordens do grupo de resistência ARMS, essa dupla improvável embarcará em uma jornada perigosa para salvar os Mecha-Ude!","first_air_date":"2024-10-04","episode_run_time":24,"vote_average":7.8,"number_of_seasons":1,"number_of_episodes":12,"created_by":[],"production_companies":["TriF Studio","Pony Canyon","BS Asahi","Kansai Television","Television Nishinippon Corporation"],"genres":["Animação","Sci-Fi & Fantasy","Action & Adventure"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/m1Qs7udIu26oQOPjEBQ9GmCpZRd.jpg","poster_path":"https://image.tmdb.org/t/p/original/6Obl3dssEeq5TvlzGsyHPDNpHz.jpg","cast":["豊永利行","Tomokazu Sugita","Yu Shimamura","Romi Park","Yuichi Nakamura"],"trailer":"N/A","seasons":{"0":{"name":"Especiais","poster_path":"https://image.tmdb.org/t/p/original/AfgI11ERuyGIE0gQsOqWU3Su1tN.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/AfgI11ERuyGIE0gQsOqWU3Su1tN.jpg","air_date":"2018-09-30","episode_count":1,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Episódio 1","overview":"N/A","air_date":"2018-09-30","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/vsVeAm8jWnbSnHXAE5ZvHJhi4jN.jpg","vote_average":0}}},"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/cOqhPyI63xRyhDSxZWyqAD1kFcM.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/cOqhPyI63xRyhDSxZWyqAD1kFcM.jpg","air_date":"2024-10-04","episode_count":12,"overview":"N/A","vote_average":9,"episodes":{"1":{"name":"A usuária de Mecha-Ude","overview":"Um dia, Hikaru Amatsuga, um estudante da cidade de Kitakagami, encontra Alma, uma forma de vida mecânica em forma de braço, que perdeu a memória. Incapaz de deixar Alma para trás, Hikaru é perseguido por drones do Grupo Kagami, que tentam recuperá-lo, e uma misteriosa usuária de Mecha-Ude.","air_date":"2024-10-04","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/rKxkYHTIkYXSyHPT2PibOQueDzR.jpg","vote_average":9},"2":{"name":"Vivemos em Mundos Completamente Diferentes","overview":"Com o pretexto de proteger Alma, a usuária de Mecha-Ude, Akira Murasame, se transfere para a classe de Hikaru. Como membro da organização ARMS, ela segue Hikaru e Alma constantemente, deixando Hikaru exausto.","air_date":"2024-10-11","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/730fdlBBuonx4QdKsedmi5dwVX6.jpg","vote_average":0},"3":{"name":"Você que estendeu a mão","overview":"Hikaru fica sabendo um pouco mais sobre o que é o Alma e, apesar de querer ajudá-lo, todos falam que ele não deve fazer nada e isso o deixa pensativo.","air_date":"2024-10-18","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/izkmkmZM6Xhn6haYUW94fkeFat0.jpg","vote_average":0},"4":{"name":"Deveria ser algo muito importante","overview":"Hikaru tenta equilibrar a vida escolar, a convivência com Alma e ser membro da ARMS, além de lidar com a perseguição de Aki. De repente, Jun Kagami se muda para sua escola com a intenção de tomar Alma para si. Será que Hikaru conseguirá tirar dele alguma informação sobre o passado de Alma?","air_date":"2024-10-25","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/jkmXGPb83FoHw8XYGjmfB2JQyFP.jpg","vote_average":0},"5":{"name":"Você está escondendo alguma coisa, não é?","overview":"Aki finalmente consegue achar o usuário de Mecha-Ude do tipo Worm que matou sua família. Ao descobrir a identidade inesperada do culpado, Aki também descobre uma outra verdade cruel e dolorosa.","air_date":"2024-11-01","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/aXSC1mInqUznLVGpCHmzrbtfztN.jpg","vote_average":0},"6":{"name":"Por \"amigos\", quero dizer...","overview":"Hikaru confronta Aki sobre seu comportamento misterioso, suspeitando que ela esteja em busca de vingança relacionada aos Mecha-Ude. Quando uma luta tensa começa entre aliados e rivais, Hikaru é forçado a tomar uma decisão difícil.","air_date":"2024-11-08","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/7fb95nkZlyV1dzUwdCgNLLDKtb3.jpg","vote_average":0},"7":{"name":"Só Porque Me Conheceu","overview":"Depois de uma luta violenta contra Amaryllis, Alma recupera sua memória e acaba fugindo de casa. Em busca de pistas sobre o paradeiro de Alma, Hikaru vai até a ARMS para falar com Fist, que conta a ele sobre o passado dos Mecha-Ude.","air_date":"2024-11-15","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/2qOXXJh2yYOq5zlJMnnqNRjkRcD.jpg","vote_average":0},"8":{"name":"Episódio 8","overview":"N/A","air_date":"2024-11-22","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/obxFcwIMGrHEdOPG4jqohmQ6viK.jpg","vote_average":0},"9":{"name":"Episódio 9","overview":"N/A","air_date":"2024-11-29","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/4qouql5uIn5p3X8rRm2sldizhvH.jpg","vote_average":0},"10":{"name":"Episódio 10","overview":"N/A","air_date":"2024-12-06","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/rKxkYHTIkYXSyHPT2PibOQueDzR.jpg","vote_average":0},"11":{"name":"Episódio 11","overview":"N/A","air_date":"2024-12-13","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/a9fuslrJpK4DdCZAzK3AR9APp9x.jpg","vote_average":0},"12":{"name":"Episódio 12","overview":"N/A","air_date":"2024-12-20","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/87NGszVfhTE5tEnRht5FRt4kbkJ.jpg","vote_average":0}}}}},
