"259787":{"id":"259787","name":"Yakuza Fiancé: Raise wa Tanin ga Ii","slug":"yakuza-fiance-raise-wa-tanin-ga-ii","original_title":"来世は他人がいい","overview":"Somei Renji é o avô de Somei Yoshino e líder do \"Grupo Somei\", o maior grupo de yakuza da região de Kansai. Quando ele prepara para ela se case com Miyama Kirishima, Yoshino tem que se mudar para a residência do \"Clã Miyama\", o maior grupo de yakuza da região de Kanto. Kirishima calorosamente recebe Yoshino e é tão agradável, bem-apessoado e gentil que ninguém suspeitaria que ele é de uma família yakuza. Isso deixa Yoshino aliviada, apesar de ela ter se sentido inicialmente insegura neste lugar desconhecido. Mas então, um certo evento leva Yoshino a conhecer o verdadeiro Kirishima.","first_air_date":"2024-10-07","episode_run_time":24,"vote_average":8.2,"number_of_seasons":1,"number_of_episodes":12,"created_by":[],"production_companies":["Studio Deen","Pony Canyon","SKY Perfect Pictures"],"genres":["Animação","Crime","Comédia","Drama"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/aPTv9g4rI31AjcSKoj1CxxfE57b.jpg","poster_path":"https://image.tmdb.org/t/p/original/9xztd5hoq0OstNRru024aAxSNWd.jpg","cast":["Hitomi Ueda","Akira Ishida","Koji Yusa","Yoji Ueda","Kazuya Nakai"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/9xztd5hoq0OstNRru024aAxSNWd.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/9xztd5hoq0OstNRru024aAxSNWd.jpg","air_date":"2024-10-07","episode_count":12,"overview":"N/A","vote_average":7.3,"episodes":{"1":{"name":"Perdedores não passarão","overview":"Somei Yoshino estava vivendo sua vida tranquilamente em Osaka até descobrir um arranjo feito entre seu avô e um conhecido dele. Depois disso, ela parte para Tóquio, indo conhecer seu noivo e futuro marido, Miyama Kirishima. Tudo isso regado a clãs Yakuza, tretas e situações inesperadas.","air_date":"2024-10-07","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/dcZjtc7xVJqsk1cFmo84GOihYuu.jpg","vote_average":6.5},"2":{"name":"Quero mostrar sinceridade. E se der certo, quero que goste de mim nem que seja um pouquinho","overview":"Yoshino se vê cada vez mais envolvida com Kirishima e sua família, mas o desaparecimento da filha do presidente das Indústrias Akaza chama sua atenção...","air_date":"2024-10-14","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/fG777fgvptkaL4Hkn1ohnHuEZ3s.jpg","vote_average":7},"3":{"name":"Um triângulo amoroso infernal","overview":"Assim como Yoshino tenta desvendar Kirishima, Kirishima também está interessado em conhecer outras facetas de Yoshino... Enquanto isso, uma importante reunião entre os grupos da Yakuza acontece em Tóquio, e Yoshino tem a oportunidade de rever rostos familiares!","air_date":"2024-10-21","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/8MozN3fFudQMUDCA6RmfJ8cQtgM.jpg","vote_average":8},"4":{"name":"Não sei se é esperto ou burro","overview":"Kirishima e Shoma finalmente se conheceram, no entanto, parece que o \"santo\" deles não bateu. À Yoshino resta ter que lidar com os sentimentos conflituosos de ambos os lados.","air_date":"2024-10-28","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/tSeHiyTwFS5BbA17UqIeq95UeFZ.jpg","vote_average":8},"5":{"name":"Princesa Tsubaki","overview":"Yoshino finalmente se recupera da forte febre que teve, e descobre que Kirishima cuidou dela mais do que imaginava. Porém, chegou a hora de voltar à escola e ela terá que correr atrás do prejuízo para ficar em dia com as matérias...","air_date":"2024-11-04","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/oppGTjER2LawziahjgGLz62XlFO.jpg","vote_average":7},"6":{"name":"Se for para ser indiferente, prefiro que você me odeie de uma vez - Parte 1","overview":"Yoshino precisa voltar à Osaka para o feriado de Finados e leva Kirishima junto. Lá, ele reencontra um velho contatinho.","air_date":"2024-11-11","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/e8Zkk8drFEwb4nKzWERXuNrpZxH.jpg","vote_average":6},"7":{"name":"Se for para ser indiferente, prefiro que você me odeie de uma vez - Parte 2","overview":"Além de Kirishima, Nao reencontra amigos da faculdade e mais um ex-namorado. Por outro lado, Yoshino continua aproveitando a sua volta para Osaka, sem saber de nada. Mas será que não sabe de nada mesmo?","air_date":"2024-11-18","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/neoaitcrPNiRrIuZCT9YqXlWp5I.jpg","vote_average":8},"8":{"name":"No fundo, eu quero casar, sim - Parte 1","overview":"Enquanto o plano de Ozu Kento vai se desenrolando para pegar Kirishima e Yoshino, os dois também pensam numa maneira de acabar com tudo de uma vez só. O que faz com que Kirishima sugira uma aposta à Yoshino.","air_date":"2024-11-25","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/uPOKw54BcOKdLjqIrnE0dmSHFFb.jpg","vote_average":7},"9":{"name":"No fundo, eu quero casar, sim - Parte 2","overview":"Yoshino segue metida na confusão e, mesmo sem entender muito do que está rolando, não está determinada a abandonar o barco.","air_date":"2024-12-02","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/ickI6hWZBJntT3c0xr4iJ5s8MfP.jpg","vote_average":8},"10":{"name":"No fundo, eu quero casar, sim - Parte Final","overview":"Juntos, Yoshino e Kirishima têm uma conversa bem \"esclarecedora\" com Ozu Kento, e aparentemente tudo se encerra da melhor forma possível... Até o casal lembrar da aposta que fez.","air_date":"2024-12-09","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/ptFPhaSDv3hm9hxLOSVVsBUkDTU.jpg","vote_average":7},"11":{"name":"Uma fera, depois de crescida, não pode mais ser domesticada","overview":"O avô de Yoshino começa a desconfiar de algumas coisas, então decide ter uma conversa franca para tirar satisfações com Kirishima...","air_date":"2024-12-16","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/zemM6S5wREkISFN764MftdRYhiH.jpg","vote_average":7},"12":{"name":"Episódio 12","overview":"N/A","air_date":"2024-12-23","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/528McUWXnd16mLbHovErfo8dzRU.jpg","vote_average":8}}}}},
