"19544":{"id":"19544","name":"Afro Samurai","slug":"afro-samurai","original_title":"Afro Samurai","overview":"A história do anime se passa em um \"Japão feudal futurístico e pós-apocalíptico\", onde, aquele que conseguir a bandana simbólica de \"Número Um\"(o homem mais forte do mundo), irá comandar o mundo, como um \"deus\". Alguém se torna o Número Um matando o antigo Número Um e tomando sua bandana. Entretanto, somente aquele que tiver a bandana de \"Número Dois\" tem direito de desafiar o Número Um. Por sua vez somente o número três pode desafiar o número dois, e assim por diante até o número sete, onde todos podem desafiá-lo.","first_air_date":"2007-01-04","episode_run_time":25,"vote_average":7.2,"number_of_seasons":1,"number_of_episodes":5,"created_by":["岡崎能士"],"production_companies":["GONZO","Fuji Television Network"],"genres":["Animação","Action & Adventure","Drama","Sci-Fi & Fantasy"],"certification":"18","backdrop_path":"https://image.tmdb.org/t/p/original/4MgI4sp5hLdz4ZZ9OieYjHk7y5N.jpg","poster_path":"https://image.tmdb.org/t/p/original/1wif9a57obZA5N1UujiluoUahkI.jpg","cast":["Samuel L. Jackson","Phil LaMarr","Yuri Lowenthal"],"trailer":"GHi8fDKggc0","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/82u4NEeVsCEyjOIeXoXPkIrXaJY.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/82u4NEeVsCEyjOIeXoXPkIrXaJY.jpg","air_date":"2007-01-04","episode_count":5,"overview":"N/A","vote_average":7.3,"episodes":{"1":{"name":"Vingança","overview":"Depois que um menino chamado Afro testemunha Justice matar seu pai e reivindicar a bandana número um, Afro começa sua jornada para vingar a morte de seu pai. Enquanto ele viaja em direção à Justice, ele é desafiado por muitos lutadores que desejam reivindicar a bandana número dois que ele usa.","air_date":"2007-01-04","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/dEFXrHgA3ohuP33SKFKzVRNHU03.jpg","vote_average":7.5},"2":{"name":"O Leitor de Sonhos","overview":"Afro é encontrado perto do rio e levado por Okiku para curar suas feridas. Em seu estado enfraquecido, ele tem uma série de sonhos sobre começar seu treinamento de samurai e seus amigos de muito tempo atrás.","air_date":"2007-01-11","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/lZKIweZIM48VOjgT8B5mf19Imwv.jpg","vote_average":7.75},"3":{"name":"O Clã dos Sete Vazios","overview":"O Afro Samurai continua em sua jornada e encontra mais informações sobre o Empty Seven Clan. O grupo de monges decidiu lançar um robô sobre o samurai, criado a partir dos dados que Okiku tirou de suas memórias.","air_date":"2007-01-18","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/98NJh3iQFsg8nbcLnWWtYm6KE52.jpg","vote_average":6.75},"4":{"name":"Duelo","overview":"Afro continua sua busca e acaba enfrentando Kuma.","air_date":"2007-01-25","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/msIjRF7DvXydVX98fsjX8xTk05d.jpg","vote_average":7.5},"5":{"name":"Justiça","overview":"Afro termina sua batalha com Kuma e continua subindo a montanha. Agora, a batalha final com a Justice está próxima. O samurai agora está pronto para finalmente vingar a morte prematura de seu pai, massacrando o atirador enlouquecido.","air_date":"2007-02-01","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/qM9gYHS4KvUbIr945ddS1CQaj4U.jpg","vote_average":7}}}}},
